import React from 'react';
import '../Css/PolicyStyle.css'
const Policy=()=>{
    return(
        <>
        <div className="policy">
            <ol>
        <li>Kami dapat mengumpulkan informasi khusus perangkat (seperti model perangkat keras, versi sistem operasi, pengidentifikasi perangkat unik, informasi jaringan seluler termasuk nomor telepon, dan lain-lain).</li>
        <li>Log adalah catatan tentang peristiwa yang terjadi dalam sistem organisasi dan jaringan yang disimpan dalam server berupa dokumen.Ketika Anda menggunakan Situs kami, kami dapat secara otomatis mengumpulkan dan menyimpan informasi dalam log server. </li>
        <li>Kami dapat mengumpulkan dan memroses informasi tentang lokasi Anda yang sebenarnya dan menggunakan berbagai teknologi untuk menentukan lokasi, termasuk alamat IP</li>
        <li>Kami dapat mengumpulkan dan menyimpan informasi (termasuk informasi pribadi) secara lokal di perangkat Anda dengan menggunakan mekanisme seperti penyimpanan web browser dan cache data aplikasi.</li>
        <li>Kami dapat menggunakan berbagai teknologi untuk mengumpulkan dan menyimpan informasi ketika Anda mengunjungi Situs kami, dan ini mungkin termasuk penggunaan cookie atau teknologi serupa untuk mengidentifikasi browser atau perangkat Anda.</li>
        <li>Kami dapat memberikan informasi pribadi kepada afiliasi kami atau bisnis atau orang terpercaya lainnya untuk memprosesnya untuk kami (atau untuk alasan serupa), berdasarkan instruksi kami dan sesuai dengan Kebijakan.</li>
            </ol>
        </div>
       
        </>
    )
}
export default Policy;
